import { initializeApp } from "firebase/app";

export const data_apt = {
  APT_KEY: import.meta.env.VITE_APT_KEY,
  APT_DOMAIN: import.meta.env.VITE_APT_DOMAIN,
  APT_URL: import.meta.env.VITE_APT_URL,
  APT_STORAGE: import.meta.env.VITE_APT_STORAGE,
  APT_MESSAGING: import.meta.env.VITE_APT_MESSAGING,
  APT_APPID: import.meta.env.VITE_APT_APPID,
};
const APT_KEY = import.meta.env.VITE_APT_KEY;
const APT_DOMAIN = import.meta.env.VITE_APT_DOMAIN;
const APT_URL = import.meta.env.VITE_APT_URL;
const APT_STORAGE = import.meta.env.VITE_APT_STORAGE;
const APT_MESSAGING = import.meta.env.VITE_APT_MESSAGING;
const APT_APPID = import.meta.env.VITE_APT_APPID;

const firebaseConfig = {
  apiKey: APT_KEY,
  authDomain: APT_DOMAIN,
  databaseURL: APT_URL,
  projectId: "umka-77a72",
  storageBucket: APT_STORAGE,
  messagingSenderId: APT_MESSAGING,
  appId: APT_APPID, // Initialize Firebaseconst app = initializeApp(firebaseConfig)
  // и другие настройки
};

const app = initializeApp(firebaseConfig);
export default app;
